selector_to_html = {"a[href=\"../../Universal/EditPermissions/edit-permissions.html#edit-permissions-universal\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Edit Permissions<a class=\"headerlink\" href=\"#edit-permissions\" title=\"Link to this heading\">#</a></h1><p>You can edit permissions for various types of users throughout the app.</p><p><strong>To Edit Permissions:</strong></p>", "a[href=\"../../Universal/UserDetails/user-details-page.html#user-details-universal-page\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">User Details Page<a class=\"headerlink\" href=\"#user-details-page\" title=\"Link to this heading\">#</a></h1><p>The <span class=\"page-reference\"><span class=\"visually-hidden\">Page: </span><span>User Details Page</span></span> opens up to the <span class=\"tab-reference\"><span class=\"visually-hidden\">Tab: </span><span>User Information</span></span> Tab</p>", "a[href=\"#id4\"]": "<figure class=\"align-center\" id=\"id4\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-status-filter.webp\" id=\"user-user-status-filter\"><img alt=\"../../_images/user-user-status-filter.webp\" id=\"user-user-status-filter\" loading=\"lazy\" src=\"../../_images/user-user-status-filter.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User Homepage, Status Filter Dropdown</span><a class=\"headerlink\" href=\"#id4\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#remaining-sections\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Remaining Sections<a class=\"headerlink\" href=\"#remaining-sections\" title=\"Link to this heading\">#</a></h3><p>The remaining sections are universally shared throughout the app.</p><p><strong>These sections include:</strong></p>", "a[href=\"#users\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Users<a class=\"headerlink\" href=\"#users\" title=\"Link to this heading\">#</a></h1><p>The <span class=\"page-reference\"><span class=\"visually-hidden\">Page: </span><span>Users Page</span></span> has the following features:</p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-homepage.webp\" id=\"user-homepage\"><img alt=\"../../_images/user-user-homepage.webp\" id=\"user-homepage\" loading=\"lazy\" src=\"../../_images/user-user-homepage.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Users, User list Table</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#filtering-the-user-table\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Filtering the User Table<a class=\"headerlink\" href=\"#filtering-the-user-table\" title=\"Link to this heading\">#</a></h3><p>The <strong>User Table</strong> can be filtered using two methods:</p>", "a[href=\"../Staff/managing-staff-accounts.html#user-staff-view-user-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View Staff User\u2019s Details<a class=\"headerlink\" href=\"#view-staff-user-s-details\" title=\"Link to this heading\">#</a></h2><p>To view a <strong>Staff User\u2019s</strong> details:</p>", "a[href=\"../../Universal/DeleteUser/delete-user-universal.html#delete-user-universal\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">How to Delete User, Staff, Company, etc.<a class=\"headerlink\" href=\"#how-to-delete-user-staff-company-etc\" title=\"Link to this heading\">#</a></h1><p>To delete a user, staff, company, or anything else throughout the app, follow these steps:</p>", "a[href=\"../Staff/managing-staff-accounts.html#information-pane-main-page\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Information Pane<a class=\"headerlink\" href=\"#information-pane\" title=\"Link to this heading\">#</a></h1><p>The <strong>Information Pane</strong> (Right Column) provides both an <strong>Activity Log</strong> and a <strong>Created &amp; Modified</strong> Section.</p>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../../_images/user-user-column-options.webp\" id=\"id1\"><img alt=\"../../_images/user-user-column-options.webp\" id=\"id1\" loading=\"lazy\" src=\"../../_images/user-user-column-options.webp\" style=\"width: 100%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">User, User, Column Options</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#user-list-table\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">User List Table<a class=\"headerlink\" href=\"#user-list-table\" title=\"Link to this heading\">#</a></h2><p>The <span class=\"table-reference\"><span class=\"visually-hidden\">Table: </span><span>User List Table</span></span> summarizes key details for each staff member, including:</p>", "a[href=\"../Staff/managing-staff-accounts.html#user-details-accounts-tab\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">User Details - Accounts Tab<a class=\"headerlink\" href=\"#user-details-accounts-tab\" title=\"Link to this heading\">#</a></h2><p>The <span class=\"page-reference\"><span class=\"visually-hidden\">Page: </span><span>User Details</span></span> page also has an <span class=\"tab-reference\"><span class=\"visually-hidden\">Tab: </span><span>Accounts</span></span> tab that allows you to view the accounts associated with the user.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
